INSERT INTO `exerciseApp_remarkexerciseuser` VALUES (5,75,90,'dsa'),(6,75,90,'dsa'),(7,75,572,'sdada'),(8,75,156,''),(9,75,154,''),(10,41,90,''),(11,66,36,''),(12,66,543,''),(13,67,4,''),(14,67,20,''),(15,11,32,''),(16,91,29,''),(17,91,45,''),(18,91,596,''),(19,11,553,''),(20,91,107,''),(21,11,29,''),(22,11,45,''),(23,37,596,''),(24,37,107,''),(25,88,31,''),(26,79,134,''),(27,79,173,''),(28,75,19,''),(29,47,106,''),(30,64,602,''),(31,95,574,''),(32,78,26,'没有思路'),(33,78,1043,'忘写‘%’'),(34,78,121,'没思路'),(35,51,19,'#include<iostream>\nusing namespace std;\nint main(){\n    int a,b,c;\n    cin>>a>>b>>c;\n    cout<<(a+b)*c;\n    return 0;\n}'),(36,91,19,'咋刷不上分\n'),(37,91,26,'还是刷不上分'),(38,91,1043,'又刷不上分'),(39,91,87,'还是刷不上分'),(40,91,121,'还是刷不上分\n'),(41,39,156,'#include<iostream>\nusing namespace std;\nint a[105][105];\nint main(){\n	int a,b,c;\n	cin>>a>>b;\n	for(int i=1;i<=a;i++){\n		for(int j=1;j<=b;j++){\n			cin>>a[i][j];\n		}\n	}\n	for(int i=1;i<=a;i++){\n		for(int i=1;i<=b;j++){\n			cin>>c;\n			cout<<a[i][j]+c<<\" \";\n		}\n		cout<<endl;\n	} \n	return 0;\n}\n'),(42,43,169,''),(43,40,150,''),(44,80,151,''),(45,78,554,'n=n-k可以简写成n-=k'),(46,88,548,''),(47,49,164,'不知道如何的计算'),(48,49,170,'不理解幻方'),(49,46,99,'bh'),(50,83,556,''),(51,40,186,'不是很能明白地毯的位置'),(52,88,70,'题目的输入是怎么输的？再检查一下'),(53,88,74,'你样例都没有试过，就提交了。先试样例'),(54,88,78,'过样例'),(55,40,636,'不知道公式如何计算'),(56,83,636,''),(57,70,43,'不知道为什么只有6分'),(58,70,106,'不知道\n'),(59,43,106,''),(60,43,187,''),(61,43,150,''),(62,43,1039,''),(63,43,585,''),(64,46,77,'ok'),(65,79,106,''),(66,35,36,'已改为long long int，原本用的是int，后来发现题目最大值大于int的最大值'),(67,35,74,'#include<iostream>\nusing namespace std;\nint main(){\n	double n,a,b,s,d,j=1;\n	cin>>n;\n	cin>>s>>d;\n	for(;j<=n;){\n		cin>>a>>b;\n		if(d/s-b/a<0.05){\n			cout<<\"better\";\n		}\n		if(d/s-b/a>0.05){\n			cout<<\"worse\";\n		}\n		if(d/s-b/a<=0.05&&s/d-a/b>=0.05){\n			cout<<\"same\";\n		}\n		j=j+1;\n	}\n	return 0;\n} \n老师我感觉与答案没啥区别，这道题我肝了40多分钟，看答案后发现自己半对，于是修改了一些地方，但样例还是出不来'),(68,95,36,'傻瓜题\n'),(69,88,61,'老师这道题那里错了？\n'),(70,88,59,'老师我写完以后对照答案检查了，没发现我那里错了?'),(71,132,36,''),(72,43,167,''),(73,43,165,''),(74,138,36,''),(75,66,568,''),(76,88,62,'老师这道题怎么做？'),(77,140,29,''),(78,35,16,'为毛5分？？？'),(79,35,48,'第一次5分，第二次4分，第三次8分'),(80,136,28,'不太懂'),(81,136,37,'这道题我做了三次，但我不知道前两个有什么错，只得了6分，是不是long long int也存不下？'),(82,35,544,'原来写法：\n#include<iostream>\nusing namespace std;\nint main(){\n	int n,m,a,s=0;\n	cin>>n>>m>>a;\n	a=a*a;\n	for(int i=1;i<=n*m;i++){\n		if(n*m%a==0){\n			s++;\n		}\n	}\n	cout<<s;\n} '),(83,140,37,''),(84,35,556,'自己以前写的10分代码：\n#include<iostream>\nusing namespace std;\nint a[13]{0,31,28,31,30,31,30,31,31,30,31,30,31};\nint main(){\n	int nian,yue,ri,s;\n	cin>>nian>>yue;\n	if(nian%100==0){\n		if(nian%400==0){\n			a[3]=29;\n		}else{\n			for(int i=1;i<=2;i++){\n				s=nian%100;\n				nian=nian/100;\n			}\n			if(s%4==0){\n				a[3]=29;\n			}\n		}\n	}\n	cout<<a[yue+1];\n	return 0;\n}'),(85,144,31,''),(86,83,1041,''),(87,35,566,'样例过不了\n#include<iostream>\n#include<iomanip>\nusing namespace std;\nint a[11];\nint main(){\n	double s=0,m=0,n=101;\n	int l,r;\n	for(int i=1;i<=10;i++){\n		cin>>a[i];\n	}\n	for(int y=1;y<=10;y++){\n		if(a[y]>m){\n			m=a[y];\n			l=y;\n		}\n	}\n	a[l]=0;\n	for(int j=1;j<=10;j++){\n		if(a[j]<n){\n			n=a[j];\n			r=j;\n		}\n	}\n	a[r]=0;\n	for(int i=1;i<=10;i++){\n		s=s+a[i];\n	}\n	s=s/10;\n	cout<<fixed<<setprecision(3)<<s;\n	return 0;\n} '),(88,72,561,'分数刷不了，过了的代码在这里\n#include <iostream>\nusing namespace std;\nint main(){\n	double i,n;\n	cin>>i;\n	if(i<=100000){\n		n=i*0.1;\n	}\n	if(i>100000&&i<=200000){\n		n=10000+(i-100000)*0.075;\n	}\n	if(i>200000&&i<=400000){\n		n=10000+100000*0.075+(i-200000)*0.05;\n	}\n	if(i>400000&&i<=600000){\n		n=10000+100000*0.075+200000*0.05+(i-400000)*0.03;\n	}\n	if(i>600000&&i<=1000000){\n		n=10000+100000*0.075+200000*0.05+200000*0.03+(i-600000)*0.015;\n	}\n	if(i>1000000){\n		n=10000+100000*0.075+200000*0.05+200000*0.03+400000*0.015+(i-1000000)*0.01;\n	}\n	printf(\"%.3lf\", n);\n} 	'),(89,72,543,'分数刷不了，过了的代码在这里\n#include <iostream>\nusing namespace std;\nint main(){\n	double x;\n	cin>>x;\n	x=x*1000+x;\n	cout<<x/7/11/13;\n}'),(90,72,568,'#include <iostream>\nusing namespace std;\nint main(){\n	int m,n,h,s=0;\n	cin>>m>>n;\n	for(int i=2;i<=n-1;i++){\n		if(m%i==0&&n%i==0){\n			s=s+1;\n			break;\n		}\n	}\n	if(s==1){\n		cout<<\"No\";\n	}else{\n		cout<<\"Yes\";\n	}\n} '),(91,35,561,'#include<iostream>\n#include<iomanip>\nusing namespace std;\nint main(){\n	double li,jg;\n	cin>>li;\n	if(li<=100000){\n		jg=li/10;\n	}\n	if(li>100000&&li<200000){\n		jg=100000/10+100000*0.075;\n	}\n	if(li>200000&&li<400000){\n		jg=200000/10+200000*0.05;\n	}\n	if(li>400000&&li<600000){\n		jg=400000/10+200000*0.03;\n	}\n	if(li>600000&&li<1000000){\n		jg=600000/10+400000*0.015;\n	}\n	if(li>=1000000){\n		jg=1000000/10;\n		li=li-1000000;\n		jg=jg+li*0.01;\n	}\n	cout<<fixed<<setprecision(3)<<jg; \n	return 0;\n}\n眼睛痛了，不想看自己哪错了\n'),(92,72,545,'#include <iostream>\nusing namespace std;\nint main(){\n	double P,R,X;\n	cin>>R>>X>>P;\n	for(int i=1;i<=P;i++){\n		X=X*((100+R)/100);\n	}\n	printf(\"%.2lf\", X);\n}'),(93,72,553,'#include <iostream>\nusing namespace std;\nint main(){\n	long long int a,b,c;\n	cin>>a>>b>>c;\n	if(a+b>c&&a+c>b&&b+c>a&&a-b<c&&a-c<b&&b-c<a){\n		if(a*a+b*b==c*c&&a*a+c*c==b*b&&b*b+c*c==a*a){\n			cout<<\"Right\";\n			\n		}\n		if(a==b&&b==c){\n			cout<<\"Equilateral\";\n		}\n		if(a*a+b*b!=c*c&&a*a+c*c!=b*b&&b*b+c*c!=a*a||a!=b||a!=c||b!=c){\n			cout<<\"General\";\n		}\n	}else{\n		cout<<\"NO\";\n	}\n	return 0;\n}'),(94,72,605,'#include <iostream>\nusing namespace std;\nint main(){\n	long long int m,n,h;\n	cin>>m>>n;\n	for(int i=1;i<=m*n;i++){\n		if(i%m==0&&i%n==0){\n			h=i;\n			break;\n		}\n	} \n	cout<<h;\n}'),(95,72,134,'#include <iostream>\n#include <string>\nusing namespace std;\nint main(){\n	string a;\n	cin>>a;\n	int n=a.length()-1;\n	for(int i=0;i<=n;i++){\n		if(a[n-1]==\'l\'&&a[n]==\'y\'){\n			for(int j=0;j<=n-2;j++){\n				cout<<a[j];\n			}\n		}\n		\n		if(a[n-1]==\'e\'&&a[n]==\'r\'){\n			for(int j=0;j<=n-2;j++){\n				cout<<a[j];\n			}\n		}\n		\n		if(a[n-2]==\'i\'&&a[n-1]==\'n\'&&a[n]==\'g\'){\n			for(int j=0;j<=n-3;j++){\n				cout<<a[j];\n			}\n		}\n		\n		if(a[n-1]!=\'l\'&&a[n]!=\'y\'&&a[n-1]!=\'e\'&&a[n]!=\'r\'&&a[n-2]!=\'i\'&&a[n-1]!=\'n\'&&a[n]!=\'g\'){\n			cout<<a;\n		}\n		return 0;\n	}\n	\n	\n	\n}'),(96,35,89,'看答案终于知道pow（）幂数怎么用的了，以前一直都没去理解pow（），现在才发现很简单'),(97,35,82,'我居然做出来了！！！'),(98,83,134,''),(99,83,132,''),(100,42,638,'这是嘛呀？？？？？\n'),(101,35,98,'<-----恭喜你'),(102,144,78,'#include<iostream>\nusing namespace std;\n\nint main()\n{\n	int jj=0,mm=0,y;\n	for(int i=1;i<=12;i++){\n		jj=jj+300;\n		cin>>y;\n		jj=jj-y;\n		if(jj<0){\n			cout<<-i;\n			return 0;\n		}\n		mm=mm+jj/100*100;\n		jj=jj%100;\n	}\n	cout<<mm*1.2+jj;\n	\n	return 0;\n}'),(103,144,74,'#include<iostream>\nusing namespace std;\n\nint main()\n{\n	double n,x,y,zongshu,youxiao;\n	cin>>n>>zongshu>>youxiao;\n	x=youxiao/zongshu;\n	for(int i=1;i<=n-1;i++){\n		cin>>zongshu>>youxiao;\n		y=youxiao/zongshu;\n		if(y-x>0.05){\n			cout<<\"better\"<<endl;\n		}\n		if(x-y>0.05){\n			cout<<\"worse\"<<endl;\n		}\n		if(x-y<=0.05&&y-x<=0.05){\n			cout<<\"same\"<<endl; \n		}\n	}\n			\n	return 0;\n}'),(104,143,602,'看不懂'),(105,143,557,'EGDGT'),(106,143,549,'FGBGDYGDFY'),(107,143,552,'GHINGKJNJGHN'),(108,143,550,'HDFYUBGDFYBVDFYB'),(109,48,87,''),(110,68,100,''),(111,155,33,''),(112,155,602,''),(113,87,595,'没看懂呢\n'),(114,155,40,''),(115,155,46,''),(116,155,557,''),(117,155,549,''),(118,155,550,''),(119,143,43,'DVFVBBF'),(120,143,51,'bvbghjbuhj'),(121,83,28,''),(122,83,126,''),(123,48,106,''),(124,40,28,''),(125,140,576,''),(126,138,576,'改'),(127,143,566,'韩国锦湖快快来看'),(128,143,561,'vghghikilofgbnjkfgbyhghgyj'),(129,47,8,'for循环要怎么写？'),(130,79,176,'太难了，不知道怎么错的？？？\n冯老师：别被吓到哦！这个题只是字多，没有那么难，不懂就问我'),(131,79,185,'不知道为什么错了？？？\n'),(132,155,576,''),(133,155,568,'飒飒'),(134,137,107,'1'),(135,138,107,'1'),(136,140,107,'1'),(137,136,180,'1'),(138,137,180,'1'),(139,135,180,'1'),(140,138,180,'1'),(141,140,180,'1');
