nt j=0;j<c;j++)\n			printf(\"%d\",sch[i][j]);\n	return 0;\n}\nvoid ten_two(char c){\n	int i=0,op=c-\'A\'+1,x[5]={};\n	while(i<5){\n		x[i]=op%2;\n		op/=2;\n		i++;\n	}\n	for(int js=4;js>=0;js--,len++)\n		ch[len]=x[js];\n}\n	void strue(int r,int c){\n		for(int i=0;i<r;i++){ \n			for(int j=0;j<c;j++){ \n				chs[i][j]=true;\n			} \n		} \n	}','2019-12-20 21:45:32.000000',0),(749,37,'图像旋转',159,10,'#include<iostream>\nusing namespace std;\nint a[101][101];\nint main(){\n	int x,y;\n	cin>>x>>y;\n	for(int i=1;i<=x;i++){\n		for(int j=1;j<=y;j++){\n			cin>>a[i][j];\n		}\n	}\n	for(int i=1;i<=y;i++){\n		for(int j=x;j>=1;j--){\n			cout<<a[j][i]<<\" \";\n		}\n		cout<<endl;\n	}\n	return 0;\n}','2019-12-07 21:00:30.000000',0),(750,37,'直方图',181,10,'#include<iostream>\nusing namespace std;\nint a[10001];\nint s[10001];\nint main(){\n	int n,t=0;\n	cin>>n;\n	for(int i=1;i<=n;i++){\n		s[i]=0;\n		cin>>a[i];\n		if(a[i]>t){\n			t=a[i];\n		}\n	}\n	for(int i=0;i<=t;i++){\n		for(int j=1;j<=n;j++){\n			if(i==a[j]){\n				s[i]++;\n			}\n		}\n	}\n	for(int i=0;i<=t;i++){\n		cout<<s[i]<<endl;\n	}\n	return 0;\n}','2019-11-30 20:52:28.000000',0),(751,37,'成绩排序',189,10,'#include<iostream>\n#include<string>\n#include<algorithm>\nusing namespace std;\nstruct xs{\n	string name;\n	int fs;\n}; \nbool s(xs a,xs b){\n	if(a.fs>b.fs){\n		return 1;\n	}\n	if(a.fs<b.fs){\n		return 0; \n	}\n	if(a.fs==b.fs){\n		if(a.name<b.name){\n			return 1;\n		}else{\n			return 0;\n		}\n	}\n}\nxs m[21];\nint main(){\n	int n;\n	cin>>n;\n	for(int i=1;i<=n;i++){\n		cin>>m[i].name>>m[i].fs;\n	}\n	sort(m+1,m+n+1,s);\n	for(int i=1;i<=n;i++){\n		cout<<m[i].name<<\" \"<<m[i].fs<<endl;\n	}\n	return 0;	\n}','2019-08-14 16:20:45.000000',0),(752,37,'整数奇偶排序',192,10,'#include<iostream>\n#include<algorithm>\nusing namespace std;\nint a[11];\nbool zxy(int a,int b){\n	if(a%2==1&&b%2==0){\n		return 1;\n	}\n	if(a%2==0&&b%2==1){\n		return 0;\n	}\n	if(a%2==1&&b%2==1){\n		if(a>b){\n			return 1;\n		}else{\n			return 0;\n		}\n	}\n	if(a%2==0&&b%2==0){\n		if